    <style>
        :root {
            --bg-gradient: linear-gradient(135deg, #0F172A 0%, #1E293B 100%);
            --glass-bg: rgba(255, 255, 255, 0.98);
            --primary-gold: #D4AF37;
            --text-main: #1E293B;
            --radius: 20px;
        }

        body, html { height: 100%; margin: 0; font-family: "Microsoft JhengHei", "ÂæÆËªüÊ≠£ÈªëÈ´î", sans-serif; background: var(--bg-gradient); color: var(--text-main); overflow: hidden; }

        .main-card {
            width: 90%; max-width: 500px;
            background: var(--glass-bg); padding: 40px;
            border-radius: var(--radius);
            box-shadow: 0 25px 50px -12px rgba(0, 0, 0, 0.5);
            text-align: center; border-top: 6px solid var(--primary-gold);
            position: absolute; top: 50%; left: 50%;
            transform: translate(-50%, -50%); z-index: 10;

        }

        .upload-area {
            background: #F1F5F9; border: 2px dashed #94A3B8; border-radius: 15px;
            padding: 25px; cursor: pointer; transition: all 0.3s ease; margin-bottom: 20px;
        }
        .upload-area.drag-over { border-color: var(--primary-gold); background: #F0F9FF; }

        .field { text-align: left; margin-bottom: 15px; }
        .field label { display: block; font-size: 13px; font-weight: 800; color: #475569; margin-bottom: 6px; }
        input { width: 100%; padding: 12px 15px; border: 1.5px solid #CBD5E1; border-radius: 10px; font-size: 15px; box-sizing: border-box; outline: none; }
        input:focus { border-color: var(--primary-gold); }

        .btn-main {
            width: 100%; padding: 16px;
            background: #0F172A; color: #FFD700;
            border: none; border-radius: 12px;
            font-size: 1.1rem; font-weight: 800;
            cursor: pointer; margin-top: 10px;
        }
        .btn-unlock { background: #059669 !important; color: white !important; }

        #progress-overlay {
            display: none; position: fixed; top: 0; left: 0;
            width: 100%; height: 100%; background: rgba(0,0,0,0.95);
            color: white; flex-direction: column; align-items: center; justify-content: center; z-index: 99999;
        }
        .spinner {
            width: 40px; height: 40px; border: 4px solid rgba(255,255,255,0.1);
            border-top: 4px solid #FFD700; border-radius: 50%;
            animation: spin 0.8s linear infinite; margin-bottom: 20px;
        }
        @keyframes spin { 0% { transform: rotate(0deg); } 100% { transform: rotate(360deg); } }

        #content-frame {
            display: none; width: 100%; height: 100%;
            background: white; position: fixed; top: 0; left: 0;
            z-index: 10000; border: none;
        }
    </style>

        function handleFiles(files) {
            const file = files[0];

            const reader = new FileReader();
            reader.onload = (ev) => {

                document.getElementById('file-label').innerText = `‚úÖ ÂéüÂßãÊ™îÊ°àÔºö${file.name}`;

        function maskFilename(name) {
            let res = name.replace(/\.html$/i, "");
            res = res.replace(/(\d{7})([\u4e00-\u9fa5])([\u4e00-\u9fa5]+)([\u4e00-\u9fa5])/, (match, date, first, mid, last) => {
                return date + first + "O".repeat(mid.length) + last;
            });
            res = res.replace(/\((.*?)\)/g, (match, content) => {
                let parts = content.split('-');
                let maskedParts = parts.map(p => {
                    if (p.length <= 2) return p;
                    return p[0] + "O".repeat(p.length - 2) + p[p.length - 1];
                });
                return `(${maskedParts.join('-')})`;
            });
            return res + ".html";
        }

        async function encryptProcess(userPwd) {
            const salt = crypto.getRandomValues(new Uint8Array(16));
            const iv = crypto.getRandomValues(new Uint8Array(12));
            const dek = crypto.getRandomValues(new Uint8Array(32)); 
            const encrypted = await encryptText(fileBuffer, dek, iv);

        async function decryptProcess(pwd) {
            const salt = b64ToU8(VAULT.salt);
            const iv = b64ToU8(VAULT.iv);
            const kek = await deriveKek(pwd, salt);
            let dek;
            try {
                dek = await unwrap(b64ToU8(VAULT.uKey), kek);
            } catch (e) {
                try {
                    dek = await unwrap(b64ToU8(VAULT.aKey), kek);
                } catch (e2) {
                    const adminKek = await deriveKek(ADMIN_PASS, salt);
                    dek = await unwrap(b64ToU8(VAULT.aKey), adminKek);
                }
            }
            const decrypted = await decryptText(VAULT.data, dek, iv);
            renderContent(decrypted);
        }

        async function deriveKek(pwd, salt) {
            const mat = await crypto.subtle.importKey("raw", new TextEncoder().encode(pwd), "PBKDF2", false, ["deriveKey"]);
            return crypto.subtle.deriveKey(
                { name: "PBKDF2", salt, iterations: ITERATIONS, hash: "SHA-256" },
                mat, { name: "AES-GCM", length: 256 }, false, ["encrypt", "decrypt"]
            );
        }

        async function wrap(dek, pwd, salt) {
            const kek = await deriveKek(pwd, salt);
            const iv = crypto.getRandomValues(new Uint8Array(12));
            const enc = await crypto.subtle.encrypt({ name: "AES-GCM", iv }, kek, dek);
            const res = new Uint8Array(12 + enc.byteLength);
            res.set(iv); res.set(new Uint8Array(enc), 12);
            return u8ToB64(res);
        }

        async function unwrap(raw, kek) {
            const dec = await crypto.subtle.decrypt({ name: "AES-GCM", iv: raw.slice(0, 12) }, kek, raw.slice(12));
            return new Uint8Array(dec);
        }

        async function encryptText(text, key, iv) {
            const k = await crypto.subtle.importKey("raw", key, "AES-GCM", false, ["encrypt"]);
            const enc = await crypto.subtle.encrypt({ name: "AES-GCM", iv }, k, new TextEncoder().encode(text));
            return u8ToB64(new Uint8Array(enc));
        }

        async function decryptText(b64, key, iv) {
            const k = await crypto.subtle.importKey("raw", key, "AES-GCM", false, ["decrypt"]);
            const dec = await crypto.subtle.decrypt({ name: "AES-GCM", iv }, k, b64ToU8(b64));
            return new TextDecoder().decode(dec);
        }

            };

            updatedScript = inject(updatedScript, "/\\*SALT_START\\*/", "/\\*SALT_END\\*/", u8ToB64(salt));

        function b64ToU8(b64) {
            const s = atob(b64);
